import React, { useState, useEffect } from 'react';
import { View, Text, Image, StyleSheet, TouchableOpacity, FlatList } from 'react-native';
import { useNavigation, useRoute } from '@react-navigation/native';
import storage from '@react-native-firebase/storage'; // Import Firebase Storage module

const CustomButton = ({ image, onPress }) => (
  <TouchableOpacity style={styles.button} onPress={onPress}>
    <Image source={image} style={styles.buttonImage} />
  </TouchableOpacity>
);

const CustomSettingsButton = ({ onPress }) => (
  <TouchableOpacity style={styles.settingsButton} onPress={onPress}>
    <Image source={require('../assets/images/Settings.png')} style={styles.settingsImage} />
  </TouchableOpacity>
);

const FeedPost = ({ post }) => {
  return (
    <View style={styles.feedPostContainer}>
      <Text>{post.username}</Text>
      <Image source={{ uri: post.image }} style={styles.feedPostImage} /> {/* Use uri for remote images */}
      {/* Add other post details as needed */}
    </View>
  );
};

const Home = () => {
  const navigation = useNavigation();
  const route = useRoute();
  const selectedImage = route.params?.newPost?.image;
  const [feedPosts, setFeedPosts] = useState([]);

  useEffect(() => {
    if (selectedImage) {
      const uploadImage = async () => {
        try {
          const response = await fetch(selectedImage.uri);
          const blob = await response.blob();
          const filename = new Date().getTime().toString();
          const uploadTask = storage().ref().child(`images/${filename}`).put(blob);

          uploadTask.on('state_changed', 
            (snapshot) => {
              console.log("Upload is " + (snapshot.bytesTransferred / snapshot.totalBytes) * 100 + "% done");
            },
            (error) => {
              console.error("Error uploading image:", error);
            },
            () => {
              uploadTask.snapshot.ref.getDownloadURL().then((downloadURL) => {
                console.log("File available at", downloadURL);
                const newPost = {
                  id: filename,
                  username: 'Stanley Kapapa',
                  image: downloadURL,
                };
                setFeedPosts((prevPosts) => [newPost, ...prevPosts]);
              });
            }
          );
        } catch (error) {
          console.error("Error fetching image:", error);
        }
      };

      uploadImage();
    }

    // Add some predefined feed posts...
  }, [selectedImage]);

  const navigateToScreen = (screenName) => {
    // Navigation logic...
  };

  const navigateToProfile = () => {
    // Navigation logic...
  };

  return (
    <View style={styles.container}>
      <View style={styles.content}>
        <Text style={styles.discoverText}>Discover</Text>
        <Text style={styles.newTodayText}>WHAT'S NEW TODAY</Text>
      </View>

      <FlatList
        data={feedPosts}
        keyExtractor={(item) => item.id} // Use id as key for FlatList
        renderItem={({ item }) => (
          <FeedPost
            post={item}
          />
        )}
        style={styles.feedList}
      />

      <CustomSettingsButton onPress={navigateToProfile} />

      <View style={styles.buttonBox}>
        {/* Button components... */}
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'space-between',
    marginBottom: 10,
  },
  content: {
    flex: 1,
    justifyContent: 'flex-start',
    alignItems: 'flex-start',
    width: '90%',
    marginBottom: -300,  // Adjusted marginBottom value
    marginRight: 50,
  },
  buttonContainer: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    alignItems: 'center',
    marginBottom: 50,
  },
  button: {
    alignItems: 'center',
  },
  buttonImage: {
    width: 50,
    height: 50,
    marginBottom: 5,
  },
  settingsButton: {
    position: 'absolute',
    top: 10,
    right: 10,
  },
  settingsImage: {
    width: 30,
    height: 30,
  },
  buttonBox: {
    backgroundColor: '#D9D9D9',
    padding: 10,
    borderRadius: 45,
    flexDirection: 'row',
    justifyContent: 'space-around',
    alignItems: 'center',
    marginTop: 20,
    marginBottom: 20,
  },
  discoverText: {
    textAlign: 'left',
    fontWeight: 'bold',
    fontSize: 20,
  },
  newTodayText: {
    textAlign: 'left',
    fontWeight: 'bold',
    fontSize: 18,
  },
  selectedImageContainer: {
    alignItems: 'center',
    marginBottom: 20,
  },
  selectedImageText: {
    fontSize: 16,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  selectedImage: {
    width: 200,
    height: 200,
  },
  feedPostContainer: {
    marginBottom: 5,
    paddingVertical: 20,
  },
  feedPostImage: {
    width: '100%',
    height: 300,
    resizeMode: 'cover',
    marginBottom: 
    1,
  },
  feedList: {
    flex: 1,
    marginVertical: 10,
  },
  // Styles...
});

export default Home;
